import style from "./ToDoLists.module.css"
import Tasks from "./Tasks/Tasks";

const ToDoLists = (props) => {

    let listsElement = props.toDoLists.map(l => <Tasks {...props}/>)

    return (

        <div className={style.toDoLists}>
            {listsElement}
            <div>
                ferta
            </div>
        </div>
    )
}

export default ToDoLists
